const stylesApi = axios.create({ baseURL: 'http://127.0.0.1:8000/styles/' })
const componentsApi = axios.create({ baseURL: 'http://127.0.0.1:8000/components/' })
elementsApi.get('').then((res) => console.log(res.data.filter(i => i.main == null)))
function App() {
